import logo from './logo.png';
import './App.css';

import {Route, Link} from "react-router-dom";
import Login from "./login";
import Front from './front.js';
import Advertisement from "./advertisement";
import Users from "./users";

function App() {
    return (
        <div className="App">
            <Login/>
            <Front/>
            <Advertisement/>
            <Users/>
        </div>
    );
}

export default App;
